@cafe_health Donna, you are right. He doesn't need to steal anything.
So WHY is he saying he's going to the Supreme Court to stop counting the ballots?
Why should ANYONE stop counting ballots before all of the ballots are counted?

@danravicher @GovernorTomWolf @JoeBiden @realDonaldTrump Trump just declared that all counting should stop and he has won.

If that's true, why doesn't he want the rest counted? Clearly trying to steal the election and deny millions of Americans right to vote. 

If that happens America is in shambles.
